import React from 'react'
import Practice from './Practice';
import Sdata from './Sdata';

const All = () => {
    
    return (
        <>
        {
            Sdata.map((val)=>{
                return(
                    <Practice key={val.id} images={val.images} />
                );
            })
        }

        </>
    )
}

export default All
